import React, { useState } from 'react';
import { Chart } from "react-google-charts";
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
import 'gridstack/dist/gridstack.min.css';
import './App.css';
import './litegride.css';
import { GridStack } from 'gridstack';
import Tema from './assets/img/tema.jpg';

function App() {
  const [options, setOptions] = useState({
    title: 'Gráfico de Pizza'
  });
  const [optionsBar, setOptionsBar] = useState({
    title: 'Gráfico de Barra'
  });
  const [data, setData] = useState([
    ['Linguagens', 'Quantidade'],
    ['React', 100],
    ['Angula', 80],
    ['Vue', 50],
  ]);
  const [dataBar, setDataBar] = useState([
    ['Cidades', '2010 População', '2000 População'],
    ['New York City, NY', 8175000, 8008000],
    ['Los Angeles, CA', 3792000, 3694000],
    ['Chicago, IL', 2695000, 2896000],
    ['Houston, TX', 2099000, 1953000],
    ['Philadelphia, PA', 1526000, 1517000],
  ]);
  const getOptions = (type) => ({
    chart: {
      type
    },
    title: {
      text: "Gráfico",
    },
    yAxis: {
      title: {
        text: 'Values',
      },
    },
    series: [
      {
        data: [1, 2, 1, 4, 3, 6],
      },
      {
        data: [2, 7, 0, 4, 6, 2],
      },
    ],
  });
  $('.grid-stack').on('gsresizestop', function (event, elem) {
    chart.reflow();
  });


  GridStack.init();
  return (
    <div className="App">
      <img className="App-logo" src={Tema} />
      <div className="grid-stack">
        <div className="grid-stack-item">
          <div className="grid-stack-item-content">
            <Chart
              width="100%"
              height="100%"
              chartType="PieChart"
              data={data}
              options={options}
            />
          </div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content"><Chart
            width="100%"
            height="100%"
            chartType="BarChart"
            data={dataBar}
            options={optionsBar}
          /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content"><Chart
            width="100%"
            height="100%"
            chartType="ScatterChart"
            data={[["Age", "Weight"], [4, 5.5], [8, 12]]}

            legendToggle
          /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content"><Chart
            width="100%"
            height="100%"
            chartEvents={[
              {
                eventName: "select",
                callback: ({ chartWrapper }) => {
                  const chart = chartWrapper.getChart();
                  const selection = chart.getSelection();
                  if (selection.length === 0) return;
                  const region = data[selection[0].row + 1];
                  console.log("Selected : " + region);
                },
              },
            ]}
            chartType="GeoChart"

            data={data}
          /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content"><Chart
            width="100%"
            height="100%"
            chartType="Histogram"
            data={data}
            options={options}
          /></div>
        </div>

        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content"> <Chart
            width="100%"
            height="100%"
            chartType="SteppedAreaChart"
            data={data}
            options={options}
            legendToggle
          /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content"> <img width="100%" height="100%" position="absolute" src={Tema} /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">
            <HighchartsReact width="100%" height="100%" position="absolute" highcharts={Highcharts} options={getOptions('line')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">
            <HighchartsReact id="highcharts" highcharts={Highcharts} options={getOptions('spline')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">
            <HighchartsReact id="highcharts" highcharts={Highcharts} options={getOptions('area')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">
            <HighchartsReact id="highcharts" highcharts={Highcharts} options={getOptions('areaspline')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">
            <HighchartsReact id="highcharts" highcharts={Highcharts} options={getOptions('column')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">
            <HighchartsReact id="highcharts" highcharts={Highcharts} options={getOptions('bar')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">
            <HighchartsReact className="highcharts" highcharts={Highcharts} options={getOptions('pie')} /></div>
        </div>
        <div className="grid-stack-item" gs-w="2">
          <div className="grid-stack-item-content">
            <HighchartsReact className="highcharts" highcharts={Highcharts} options={getOptions('scatter')} /></div>
        </div>

      </div>
    </div>
  );
}

export default App;
